#!/bin/bash
# <bitbar.title>GitLab  Status</bitbar.title>
# <bitbar.version>v1.0</bitbar.version>
# <bitbar.author>Hugo Lafitte</bitbar.author>
# <bitbar.author.github>deed-app</bitbar.author.github>
# <bitbar.desc>This plugin displays your last GitLab CI pipeline status</bitbar.desc>
# <bitbar.dependencies>jq</bitbar.dependencies>
# <bitbar.abouturl>https://github.com/deed-app/bitbar-gitlab-ci-status</bitbar.abouturl>
# <bitbar.image>https://raw.githubusercontent.com/deed-app/bitbar-gitlab-ci-status/master/presentation.jpg</bitbar.image>
#
# 'jq' can be installed with brew from: https://stedolan.github.io/jq/
# One-liner:
# brew install jq

################################################
################################################
##### CONFIGURATION
################################################
################################################

GITLAB_HOSTNAME="https://your-gitlab-.com"
GITLAB_API_TOKEN="YOUR_TOKEN"
GITLAB_PROJECT_ID="1"

################################################
################################################
##### CORE
################################################
################################################
 

FONT_SIZE="13"
GITLAB_LOGO=""
PIPELINE_JSON="$(curl --silent --output -H "Content-Type: application/json" -H "PRIVATE-TOKEN: $GITLAB_API_TOKEN" $GITLAB_HOSTNAME/api/v4/projects/$GITLAB_PROJECT_ID/pipelines?per_page=1&page=1)"

SINGLE_PIPELINE=$(echo $PIPELINE_JSON | /usr/local/bin/jq -er ".[0]" 2> /dev/null)
if [ $? -ne 0 ]
then
  echo "No build | color=#CC0000 size=$FONT_SIZE image=$GITLAB_LOGO"
  exit 1;
fi

PIPELINE_ID=$(echo $PIPELINE_JSON | /usr/local/bin/jq -er ".[0] | .id")
PIPELINE_SHA=$(echo $PIPELINE_JSON | /usr/local/bin/jq -er ".[0] | .sha")
PIPELINE_REF=$(echo $PIPELINE_JSON | /usr/local/bin/jq -er ".[0] | .ref")

PIPELINE_STATUS=$(echo $PIPELINE_JSON | /usr/local/bin/jq -er ".[0] | .status")
if [ $? -ne 0 ]
then
  echo "Unknown Status | color=#CC0000 size=$FONT_SIZE image=$GITLAB_LOGO"
  exit 1;
fi

case "$PIPELINE_STATUS" in
    ("pending") LABEL="Pending"; COLOR="#666666" ;;
    ("running") LABEL="Running"; COLOR="#FFCC00" ;;
    ("success") LABEL="Passed"; COLOR="#00B200" ;;
    ("failed") LABEL="Failed"; COLOR="#CC0000" ;;
    ("canceled") LABEL="Canceled"; COLOR="#666666" ;;
    (*) LABEL="Skipped"; COLOR="#666666" ;;
esac

echo " $LABEL | color=$COLOR size=$FONT_SIZE image=$GITLAB_LOGO trim=false"
echo ---
echo "$GITLAB_HOSTNAME (pipeline $PIPELINE_ID)"
echo "Reference: $PIPELINE_REF"
echo ---
echo "$PIPELINE_SHA"